import "./works.scss";
import {
    featuredPortfolio,
    webPortfolio,
    mobilePortfolio,
    designPortfolio,
    contentPortfolio
} from "../../data.js";

export default function Works() {
    return (
        <div className='works' id="works">

            {featuredPortfolio.map((d) => (<div className="container">
                <div className="itemContainer">
                    <div className="item">
                        <div className="left">
                            <p>{d.title}</p>
                        </div>
                        <div className="right">
                            <img src={d.img} />
                        </div>
                    </div>
                </div>
            </div>))}

        </div>
    )
}
